import React from 'react';
import CatImage from '../../assets/images/main-logo.jpg';
import IconComponent from '../../components/icon/icon.component';
import IconInfo from '../../components/icon-info/icon-info.component';
import {Card, CardContent} from '@material-ui/core';
import './main-page.styles.scss';

const MainPage = () => {

    return (
        <div className='main-page'>
            
            <div className="logo-container">
                <div className="image-box">

                </div>

                <div className="text-box">
                <div className="text-info">
                    <div className="main-icon-box">
                        <IconComponent type='Pawgreen' />
                    </div>
                  
                    <h1>Find Friend</h1>
                    <p>The extension comes with three pre-built pages to help you get started faster. You can change the text and images and you're good to go.</p>
                    
                   <IconInfo type='SearchBlack'/>
                   <IconInfo type='DogGreen'/>
                   <IconInfo type='SearchBlack'/>
                    
                   
                    
                    </div>
                     </div>
                
            </div>

           
        </div>
    )
}

export default MainPage;
